'use strict';

let bEnableDebugText = true;
let debugTextLayers = [];
let debugTextFlashColor = new Vec3(0.5, 1.0, 1.0);
let debugTextColor = new Vec3(1.0, 1.0, 1.0);
let debugTextSize = 12;
let debugTextAlpha = 0.75;
let debugTextFlashScale = 1.01;
/** How many milliseconds to fade from the flash color to the normal color when the text is updated. */
let debugTextFlashTime = 250;
/** How many milliseconds to display the text before starting to fade out. */
let debugTextStickTime = 500;
/** How many milliseconds to fade out the debug text before removing it. */
let debugTextFadeTime = 1500;

export function update() {
	let currentTime = new Date().getTime();
	debugTextLayers.forEach(
		function(textLayer, index, array) {
			if (currentTime > textLayer.lastUpdated + (debugTextStickTime + debugTextFadeTime)) {
				textLayer.alpha = 0;
				thisScene.destroyLayer(textLayer);
				array.splice(index, 1);
			}
			else if (currentTime > textLayer.lastUpdated + debugTextStickTime) {
				textLayer.color = debugTextColor;
				let fadeLerp = (currentTime - (textLayer.lastUpdated + debugTextStickTime)) / debugTextFadeTime;
				textLayer.alpha = OMGHelpers.lerp(debugTextAlpha, 0, fadeLerp);
			}
			else {
				let flashLerp = OMGHelpers.clamp((currentTime - textLayer.lastChanged) / debugTextFlashTime);
				textLayer.color = OMGHelpers.lerp(debugTextFlashColor, debugTextColor, flashLerp);
				textLayer.scale = new Vec3(OMGHelpers.lerp(debugTextFlashScale, 1, flashLerp));
				textLayer.alpha = debugTextAlpha;
			}
			textLayer.origin = new Vec3(0, engine.canvasSize.y - index * (debugTextSize * 3 + 10), 0);
			textLayer.visible = bEnableDebugText;
		}
	);
}

class OMGHelpers {
	/** Prints all key/value pairs present on the object to the console. */
	static printObjectValues(obj){
		if (typeof(obj) !== 'object' || obj === null)
			return;

		let keys = Object.keys(obj);
		for (let i = 0; i < keys.length; ++i)
			console.log(keys[i] + " - " + obj[keys[i]]);
	}

	static add(v1, v2) {
		if (v2 === undefined)
			return v1;
		if (typeof v1 === 'number' || typeof v1 === 'string')
			return v1 + v2;
		else
			return v1.add(v2);
	}

	/** Restricts a value to remain between two boundary values. 
	 * @param {number} val - The value to be restricted.
	 * @param {number} min - The lower bound.
	 * @param {number} max - The upper bound.
	*/
	static clamp(val, min = 0, max = 1) {
		switch (typeof val) {
		case "number":
			return Math.min(max, Math.max(min, val));
			break;
		default:
			return 0;
			break;
		}
	}

	static lerp(v1, v2, percent) {
		if (typeof(v1) === "number")
			return v1 + (v2 - v1) * percent;
		else if (v1 instanceof Vec2) {
			let x = v1.x + (v2.x - v1.x) * percent;
			let y = v1.y + (v2.y - v1.y) * percent;
			return new Vec2(x, y);
		}
		else if (v1 instanceof Vec3) {
			let x = v1.x + (v2.x - v1.x) * percent;
			let y = v1.y + (v2.y - v1.y) * percent;
			let z = v1.z + (v2.z - v1.z) * percent;
			return new Vec3(x, y, z);
		}
		else if (v1 instanceof Vec4) {
			let x = v1.x + (v2.x - v1.x) * percent;
			let y = v1.y + (v2.y - v1.y) * percent;
			let z = v1.z + (v2.z - v1.z) * percent;
			let w = v1.w + (v2.w - v1.w) * percent;
			return new Vec4(x, y, z, w);
		}
		else
			return undefined;
	}

	static stackTrace() {
		return console.log(new Error().stack);
	}

	/** Creates or updates a text layer in the corner of the screen. 
	 * @param {string} name - The name of the text layer to create or update.
	 * @param {string} text - The text that the layer should display.
	*/
	static debugText(name, text) {
		if (bEnableDebugText && name !== undefined && text !== undefined) {
			let layer = thisScene.getLayer(name);
			if (layer) {
				if (layer.text != text) {
					layer.text = text;
					layer.lastChanged = layer.lastUpdated = new Date().getTime();
					layer.color = debugTextFlashColor;
					layer.scale = new Vec3(debugTextFlashScale);
				}
				else
					layer.lastUpdated = new Date().getTime();
			}
			else {
				let layerSettings = new Object();
				layerSettings.name = name;
				layerSettings.text = text;
				layerSettings.pointsize = debugTextSize;
				layerSettings.font = "systemfont_consolas";
				layerSettings.origin = "0, " + (engine.canvasSize.y - debugTextLayers.length * (debugTextSize * 3 + 10)) + ", 0";
				layerSettings.verticalalign = "top";
				layerSettings.horizontalalign = "left";
				layerSettings.color = debugTextFlashColor.x + ", " + debugTextFlashColor.y + ", " + debugTextFlashColor.z;
				layerSettings.alpha = debugTextAlpha;
				layer = thisScene.createLayer(layerSettings)
				layer.lastChanged = layer.lastUpdated = new Date().getTime();
				debugTextLayers.push(layer);
			}
		}
	}
}

