'use strict';

class OMGVector {
	/**
	 * @param {Vec3} vector
	 * @param {Number} angle
	 * Rotates around the X axis by angle radians
	 */
	static rotX(vector, angle){
		let cos = Math.cos(angle);
		let sin = Math.sin(angle);
		return new Vec3(
			vector.x, 
			vector.y * cos - vector.z * sin,
			vector.y * sin + vector.z * cos)
	};

	static rotY(vector, angle){
		let cos = Math.cos(angle);
		let sin = Math.sin(angle);
		return new Vec3(
			vector.x * cos + vector.z * sin,
			vector.y, 
			-vector.x * sin + vector.z * cos)
	};

	static rotZ(vector, angle){
		let cos = Math.cos(angle);
		let sin = Math.sin(angle);
		return new Vec3(
			vector.x * cos - vector.y * sin,
			vector.x * sin + vector.y * cos,
			vector.z)
	};

	static rotAxis(vec, angle, axis){
		let cos = Math.cos(angle);
		let sin = Math.sin(angle);
		return new Vec3(
			(cos + (1 - cos) * axis.x * axis.x) * vec.x +
			((1 - cos) * axis.x * axis.y - axis.z * sin) * vec.y +
		((1 - cos) * axis.x * axis.z + axis.y * sin) * vec.z,

		((1 - cos) * axis.x * axis.y + axis.z * sin) * vec.x +
		(cos + (1 - cos) * axis.y * axis.y) * vec.y +
		((1 - cos) * axis.y * axis.z - axis.x * sin) * vec.z,

		((1 - cos) * axis.x * axis.z - axis.y * sin) * vec.x +
		((1 - cos) * axis.y * axis.z + axis.x * sin) * vec.y +
		(cos + (1 - cos) * axis.z * axis.z) * vec.z);
	};

	static rotVec(vector, angles){
		let r = rotX(vector, angles.x);
		r = rotY(r, angles.y);
		return r = rotZ(r, angles.z);
	};

	static unrotVec(vector, angles){
		let r = rotZ(vector, -angles.x);
		r = rotY(r, -angles.y);
		return r = rotX(r, -angles.z);
	};

	static forwardY(angles){
		return rotVec(new Vec3(0., 1., 0.), angles);
	};

	static forwardZ(angles){
		return rotVec(new Vec3(0., 0., 1.), angles);
	};

	static forwardX(angles){
		return rotVec(new Vec3(1., 0., 0.), angles);
	};

	static interpAngle(angle1, angle2, percent){
		let a1 = [angle1.x % 360, angle1.y % 360, angle1.z % 360];
		let a2 = [angle2.x % 360, angle2.y % 360, angle2.z % 360];
		let diff = [];
		for (let i = 0; i < 3; i++){
			if (a1[i] < 0)
				a1[i] += 360;
			if (a2[i] < 0)
				a2[i] += 360;
			diff[i] = a2[i] - a1[i];
			if (diff[i] > 180)
				diff[i] -= 360;
			else if (diff[i] < -180)
				diff[i] += 360;
		}
		return new Vec3(a1[0] + diff[0] * percent, a1[1] + diff[1] * percent, a1[2] + diff[2] * percent);
	};

	static interpPosition(pos1, pos2, percent){
		return lerp(pos1, pos2, percent);
	}

	/**
	 * Interpolates linearly between v1 and v2 based on percent (0 to 1).
	 * @param {Vec3} v1 First vector
	 * @param {Vec3} v2 Second vector
	 * @param {Number} percent interpolation value between 0 and 1
	 */
	static lerp(v1, v2, percent){
		let x = v1.x + (v2.x - v1.x) * percent;
		let y = v1.y + (v2.y - v1.y) * percent;
		let z = v1.z + (v2.z - v1.z) * percent;
		return new Vec3(x, y, z);
	};


	static magnitude(vec){
		return Math.sqrt(vec.x * vec.x + vec.y * vec.y + vec.z * vec.z);
	}

	static normalize(vec){
		return vec.multiply(1 / OMGVector.magnitude(vec));
	};
}

shared.OMGVector = OMGVector;

'use strict';
const OMGHelpers = shared.OMGHelpers;

/** @type {Interpolator[]} */
let activeInterps = [];


export function update() {
	activeInterps.forEach((interp, index, array) => {
		interp.update(engine.frametime + (shared.timeNudge || 0));
	});
	shared.timeNudge = 0;
}



/** 
 * @typedef {Object} InterpolatorParams
 * @property targetObject {object} - The object whose property value will be modified
 * @property propertyName {String} - The name of the property key to be modified
 * @property duration {Number} - How long it will take to reach the final value.
 * @property startValue {object} - An optional starting value. If not set, will use the properties existing value.
 * @property startOffset {object} - An optional offset to the starting value.
 * @property endValue {object} - The value the target variable will reach at the end of the duration. If not set, will use the properties existing value.
 * @property endOffset {object} - An optional offset to the end value.
 */

/** Modifies an object property over a period of time */
class Interpolator {
	/** 
	 * @param {InterpolatorParams} params - Object containing the parameters for initilization.
    */
	constructor(params) {
		this.targetObject = params.targetObject;
		this.propertyName = params.propertyName || "origin";
		this.duration = params.duration || 1.0;
		this.elapsedTime = 0;
		activeInterps.push(this);

		if (params.startValue !== undefined)
			this.startValue = OMGHelpers.add(params.startValue, params.startOffset);
		else
			this.startValue = OMGHelpers.add(this.targetValue, params.startOffset);

		if (params.endValue !== undefined)
			this.endValue = OMGHelpers.add(params.endValue, params.endOffset);
		else
			this.endValue = OMGHelpers.add(this.targetValue, params.endOffset);
	}

	get targetValue() {return this.targetObject[this.propertyName]}
	set targetValue(newValue) {return this.targetObject[this.propertyName] = newValue}

	update(dt) {
		this.elapsedTime += dt;
		if (this.elapsedTime > this.duration) {
			this.finish();
			this.destroy();
		}
		else
			this.interpolate();
	}

	interpolate() {
		// Perform interpolation here
	}

	finish() {
		this.targetValue = this.endValue;
	}

	destroy() {
		activeInterps.splice(activeInterps.indexOf(this), 1);
	}
}


/** Transitions from the start to end value at a constant rate. */
class LinearInterp extends Interpolator {
	interpolate() {
		let percentage = this.elapsedTime / this.duration;
		this.targetValue = OMGHelpers.lerp(this.startValue, this.endValue, percentage);
	}
}
shared.LinearInterp = LinearInterp;



/** Transitions from the start to end value, moving slowly at first then speeding up. */
class EaseOutInterp extends Interpolator {
	interpolate() {
		let percentage = this.elapsedTime / this.duration;
		this.targetValue = OMGHelpers.lerp(this.startValue, this.endValue, percentage * (2 - percentage));
	}
}
shared.EaseOutInterp = EaseOutInterp;



/** Transitions from the start to end value, moving slowly at first then speeding up. */
class EaseOutStrongInterp extends Interpolator {
	interpolate() {
		let percentage = this.elapsedTime / this.duration;
		this.targetValue = OMGHelpers.lerp(this.startValue, this.endValue, Math.pow(percentage-1, 3) + 1);
	}
}
shared.EaseOutStrongInterp = EaseOutStrongInterp;



/** Transitions from the start to end value, moving slowly at first then speeding up. */
class EaseInInterp extends Interpolator {
	interpolate() {
		let percentage = this.elapsedTime / this.duration;
		this.targetValue = OMGHelpers.lerp(this.startValue, this.endValue, Math.pow(percentage, 2));
	}
}
shared.EaseInInterp = EaseInInterp;



/** Transitions from the start to end value, moving slowly at first, quickly in the middle, then slow again at the end. */
class EaseInOutInterp extends Interpolator {
	interpolate() {
		let x = this.elapsedTime / this.duration;
		this.targetValue = OMGHelpers.lerp(this.startValue, this.endValue, x * x * (3 - 2 * x));
	}
}
shared.EaseInOutInterp = EaseInOutInterp;

'use strict';
const OMGHelpers = shared.OMGHelpers;
// const ScenePhase = shared.ScenePhase || function() {return shared.ScenePhase};
