// These values aren't defined yet, but assigning them here gives us intellisense.
// We assign the actual class pointers in init().
let ScenePhase = shared.ScenePhase; 
let SceneManager = shared.SceneManager;

let a_TitleMusicOld = engine.registerAsset("sounds/menu.ogg");
let a_TitleMusic = engine.registerAsset("sounds/muTitle.ogg");
let a_TitleAmbient = engine.registerAsset("sounds/title-ambient.ogg");
let music = undefined;

const musicRepeatDelayOld = 37.0;
const musicRepeatDelay = 36.25;
const fadeDuration = 1.0;
let currentTime = new Date().getTime();

let activeMusic = [];
let activeSounds = [];



export function init(value) {
	ScenePhase = shared.ScenePhase;
	SceneManager = shared.SceneManager;
}


export function update(value) {
	AudioManager.update();
}



/**
 * @param {Object} userProperties
 */
export function applyUserProperties(userProperties) {
	if (userProperties.music != undefined && userProperties.music != music) {
		music = userProperties.music;
		if (SceneManager.phase === ScenePhase.MAIN || SceneManager.phase === ScenePhase.MAIN.INTRO)
			AudioManager.startMusic();
	}
}



class AudioManager {
	static update() {
		currentTime = new Date().getTime();

		// Update active sounds
		activeSounds.forEach(
			function(soundLayer, index, array) {
				soundLayer.update();
				if (soundLayer.isDone) {
					array.splice(index, 1);
				}
			}
		);


		// Update active music
		activeMusic.forEach(
			function(musicLayer, index, array) {
				musicLayer.update();
				if (musicLayer.isDone) {
					array.splice(index, 1);
				}
			}
		);
	}

	static isMusicPlaying() {
		let bMusicPlaying = false;
		activeMusic.forEach(
			function(musicLayer, index, array) {
				if (musicLayer.isPlaying)
					bMusicPlaying = true;
			}
		);
		return bMusicPlaying;
	}


	/** Start fading out all active audio */
	static stopMusic() {
		activeMusic.forEach(
			function(musicLayer, index, array) {
				musicLayer.startFade();
			}
		);
	}

	/** Fades out any current music and begins playing the music set in the settings. */
	static startMusic() {
		// Fade out any active music
		this.stopMusic();

		let newMusic = undefined;

		switch (music) {
		case "Old":
			newMusic = new MusicLayer(a_TitleMusicOld, 0.5, musicRepeatDelayOld);
			break;
		case "New":
			newMusic = new MusicLayer(a_TitleMusic, 0.5, musicRepeatDelay);
			newMusic = new MusicLayer(a_TitleAmbient, 0.5, musicRepeatDelay);
			break;
		case "Ambient":
			newMusic = new MusicLayer(a_TitleAmbient, 0.5, musicRepeatDelay);
			break;
		case "None":
		default:
			break;
		}

		return newMusic;
	}

	/** Plays a single sound
	 * @returns {SoundLayer} The created sound layer
	 */
	static playSound(asset, volume = 0.5) {
		return new SoundLayer(asset, volume);
	}
}
shared.AudioManager = AudioManager;



class AudioLayer {
	constructor(asset, volume = 0.5) {
		this.asset = asset;
		let layerSettings = new Object();
		layerSettings.sound = asset;
		layerSettings.volume = volume;
		layerSettings.startsilent = true;
		this._layer = thisScene.createLayer(layerSettings);
	}

	get volume() {return this._layer.volume}
	set volume(val) {return this._layer.volume = val}
	pause() {_layer.pause()}
	stop() {_layer.stop()}
	play() {_layer.play()}

	update() {}

	destroy() {
		this.isDone = true;
		this._layer.stop();
		thisScene.destroyLayer(this._layer);
	}
}


/** Plays the given sound asset once, then destroys itself. */
class SoundLayer extends AudioLayer{
	constructor(asset, volume = 0.5) {
		super(asset, volume);
		this._layer.playbackmode = "single";
		this.hasPlayed = false;
		activeSounds.push(this);
	}

	update() {
		// Delayed start to prevent audio hiccups
		if (!this._layer.isPlaying()) {
			if (!this.hasPlayed) {
				this._layer.play();
				this.hasPlayed = true;
			}
			else {
				this.destroy();
			}
		}
	}
}



/** Audio layer that crossfade loops itself after the specified repeat delay */
class MusicLayer extends AudioLayer{
	constructor(asset, volume = 0.5, repeatDelay = 9999){
		super(asset, volume);
		this.unfadedVolume = volume;
		this._layer.playbackmode = "single";
		/** How many seconds to play before the track loops */
		this.repeatDelay = repeatDelay;
		/** The track will fade out for this many seconds whenever it loops */
		this.fadeDuration = fadeDuration;
		activeMusic.push(this);
	}

	set volume(val) {return super.volume = this.unfadedVolume = val}
	get volume() {return this.unfadedVolume}
	get isPlaying() {return (this.startTime && !this.bFadingOut)}

	update() {
		// Fade out then kill layer
		if (this.bFadingOut) {
			if (currentTime > this.fadeEndTime) {
				this.destroy();
			}
			else {
				let fadeLerp = (currentTime - this.fadeStartTime) / (this.fadeEndTime - this.fadeStartTime);
				this._layer.volume = OMGHelpers.lerp(this.unfadedVolume, 0, fadeLerp);
			}
		}
		// Delayed start to prevent audio hiccups
		else if (!this._layer.isPlaying() && this.startTime === undefined) {
			this._layer.play();
			this.startTime = currentTime;
			this.endTime = this.startTime + this.repeatDelay * 1000;
		}
		// Fade out and repeat when music ends
		else {
			// Start new audio
			if (currentTime > this.endTime) {
				this.startFade();
				let newLayer = new MusicLayer(this.asset);
				newLayer.repeatDelay = this.repeatDelay;
				newLayer.volume = this.unfadedVolume;
			}
		}
	}

	startFade() {
		this.bFadingOut = true;
		this.fadeStartTime = currentTime;
		this.fadeEndTime = currentTime + this.fadeDuration * 1000;
	}
}

